    <React.Fragment>
      <h1>Hello!</h1>
      {name && <h1> Hello! {name} :) </h1>}
      {['🐯', '💙'].map((item) => (
        <h1>{item}</h1>
      ))}
    </React.Fragment>
  );
}

export default App;
